import {React} from "react";
import {Link} from "react-router-dom";
import styled from "styled-components";
import Header from "./Header";
import MASHA from "./MASHA.png";
import masha from "./masha .png";




const Home = () => {
    return (
        <PageContainer>
            <Header/>
            <LandingContainer>
                <img src={MASHA} height='100%' alt={'pic'} style={{zIndex: "1"}}></img>
                <img src={masha} height='104%' alt={'pic'} style={{position:'absolute', top: "50px", left: "537px", zIndex: "1"}}></img>
            </LandingContainer>
            <SeparatorContainer>
                <Title>MASHA</Title>
            </SeparatorContainer>

        </PageContainer>

    )
}


const PageContainer = styled.div`
    display: flex;
    overflow: hidden;
    width: 100%;
    flex-direction: column;
    justify-content: start;
    align-items: stretch;
    color: #fff;
    background-color: #171819;
    gap: 0;
`;

const LandingContainer = styled.div`
    height: 105vh;
    text-align: start;
    display: flex;
    flex-direction: column;
    overflow: hidden;
    justify-content: center;
    align-items: center;
    color: #fff
`;

const HomeContainer = styled.div`
    height: 100vh;
    text-align: start;
    display: flex;
    flex-direction: row;
    justify-content: space-between;
    align-items: center;
    padding-left: 120px;
    padding-right: 120px;
    background-color: #0A0A0A;
    color: #fff;
    z-index: 0;
`;

const DescriptionContainer = styled.div`
    max-height: 100vh;
    min-height: 75vh;
    text-align: start;
    display: flex;
    flex-direction: row;
    justify-content: space-between;
    align-items: center;
    padding-left: 120px;
    padding-right: 120px;
    background-color: #0A0A0A;
    color: #fff;
    z-index: 0;
`;

const SeparatorContainer = styled.div`
    overflow: hidden;
    text-align: start;
    display: flex;
    flex-direction: row;
    justify-content: start;
    align-items: start;
    margin: 50px 0;
    padding-left: 85px;
    background-color: #171819;
    color: #fff;
    z-index: 0;
`;

const Title = styled.div`
    font-size: 96px;
    font-weight: 500;
    color: #fff;
    text-shadow: 1px 1px 5px rgba(0,0,0,1);
    z-index: 1;
`;

const TitleGreen = styled.div`
    font-size: 96px;
    font-weight: 500;
    color: #0AD70A;
    letter-spacing: 15px;
    text-shadow: 1px 1px 5px rgba(0,0,0,1);
    z-index: 1;
`;

const SubTitle = styled.div`
    font-size: 32px;
    font-weight: 200;
    padding: 0px 10px;
    color: #fff;
    text-shadow: 1px 1px 5px rgba(0,0,0,0.5);
    z-index: 1;
`;


const StyledButton = styled.button`
    background-color: #0AD70A;
    color: #0a0a0a;
    //background-color: #fff;
    margin-top: 30px;
    margin-right: 10px;
    font-size: 18px;
    font-weight: 500;
    padding: 20px 40px;
    border: 2px solid #0AD70A;
    //border-radius: 30px;
    //text-shadow: 2px 1px 2px rgba(0,0,0,0.3);
    //box-shadow: 2px 4px 5px rgba(0,0,0,0.7);
    z-index: 1;
    transition: all 0.2s ease-in-out;
    &:hover {
        background-color: #0a0a0a;
        color: #0AD70A;
        border: 2px solid #0AD70A;
        transition: all 0.2s ease-in-out;
    }
`;


const Styledvideo = styled.video`
    position: absolute;
    top: -75px;
    left: -0px;
`;



export default Home;
